import React from "react";

function ToDoList(props) {
  return (
    <div>
      {props.todos.map((todo) => (
        <div key={todo} className="row">
          <div className="col-9">
            <h3>{todo}</h3>
          </div>
          <div className="col-3">
            <button
              className="btn btn-danger btn-sm ml-4"
              onClick={() => props.handleDelete(todo)}
            >
              Delete
            </button>
          </div>
        </div>
      ))}
    </div>
  );
}

export default ToDoList;
